INSERT INTO `goods` VALUES (7010, 39, 413, 23, 'Kingston MiniSD  2GB', 'Карты памяти стандарта miniSD предназначены для использования в сверхсовременных мультимедийных мобильных телефонах, набор функций которых включает фотосъемку, воспроизведение MP3-файлов и обмен электронными сообщениями. Специальный адаптер, входящий в комплект поставки, позволяет значительно расширить эксплуатационную гибкость карт памяти miniSD, обеспечивая их совместимость со всеми устройствами, поддерживающими стандарт SD.', 55.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1138', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7009, 39, 413, 23, 'Kingston MiniSD  1GB', 'Карты памяти стандарта miniSD предназначены для использования в сверхсовременных мультимедийных мобильных телефонах, набор функций которых включает фотосъемку, воспроизведение MP3-файлов и обмен электронными сообщениями. Специальный адаптер, входящий в комплект поставки, позволяет значительно расширить эксплуатационную гибкость карт памяти miniSD, обеспечивая их совместимость со всеми устройствами, поддерживающими стандарт SD.', 29.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1137', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7008, 39, 413, 23, 'Kingston microSD (TransFlash)  1GB', 'Карты памяти стандарта TransFlash - миниатюрные съемные устройства флэш-памяти, предназначеные в первую очередь для использования в сверхсовременных мобильных телефонах, набор функций которых включает цифровую фотосъемку, воспроизведение MP3-файлов, видео-игры, органайзер и т.д Скорость передачи данных карты стандарта TransFlash достигает 5.3 Mb/сек. В комплекте с картами TransFlash поставляется адаптер, позволяющий использовать их в стандартном разъеме SD.', 29.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1139', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7006, 3, 60, 23, '       Sony Ericsson W950i', 'W950i Walkman® – это изящный и стильный мобильный телефон, готовый к работе в сетях третьего поколения. W950i отличается оптимальной простотой в использовании благодаря современному цифровому музыкальному проигрывателю и большому сенсорному экрану. Пользоваться W950i очень просто. Выбирать и открывать элементы меню удобно с помощью сенсорного экрана и стилуса.', 530.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=238', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7007, 39, 412, 23, 'Sandisk microSD (TransFlash)  1GB', 'Карты памяти стандарта TransFlash - миниатюрные съемные устройства флэш-памяти, предназначеные в первую очередь для использования в сверхсовременных мобильных телефонах, набор функций которых включает цифровую фотосъемку, воспроизведение MP3-файлов, видео-игры, органайзер и т.д Скорость передачи данных карты стандарта TransFlash достигает 5.3 Mb/сек. В комплекте с картами TransFlash поставляется адаптер, позволяющий использовать их в стандартном разъеме SD.', 40.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=438', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7004, 3, 60, 23, '       Sony Ericsson W710i', 'Телефон W710i Walkman® – для людей, которые ведут активный образ жизни. Тренируетесь ли вы в помещении или на спортивной площадке, W710i всегда будет с вами, чтобы вы могли оставаться в великолепной форме и в курсе всех событий.', 300.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=241', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7005, 3, 60, 23, '       Sony Ericsson Z710i', 'Откройте для себя изысканный стиль Z710i. Этот раскладной телефон совмещает в себе удобные функции звонка, обмена сообщениями, цифровой камеры и целый ряд возможностей подключения, дополняемые стильным и изысканным дизайном.', 230.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=240', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7002, 3, 60, 23, '       Sony Ericsson Z610i', 'Вам захочется прикоснуться к нему. Проведите пальцами по его корпусу - его округлые формы неповторимы; ощутите кожей высокое качество его отделки. Попробуйте найти внешний дисплей, замаскированный под обычное зеркало, – он проявляется только при активации Z610i.', 276.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1076', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7003, 3, 60, 23, '       Sony Ericsson W850i', 'С телефоном W850i Walkman® вы подниметесь на следующую ступень эволюции мобильной музыки. Он объединяет сразу три устройства: мобильный телефон, качественный проигрыватель Walkman® и камеру. И ко всему прочему, он изящен, элегантен и компактен. W850i – телефон для полноты ваших ощущений.', 376.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=239', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7001, 3, 60, 23, '       Sony Ericsson W810i', 'W810 Walkman® – это стильный музыкальный проигрыватель, оснащенный всем необходимым для наслаждения музыкой в мобильном стиле. Простой в использовании цифровой проигрыватель Walkman® располагает папками для систематизации музыкальных файлов по исполнителям или создания пользовательских списков воспроизведения. Карта памяти Memory Stick PRO™ Duo объемом 512 Мб позволяет сохранить до 20 звуковых компакт-дисков максимальной продолжительности. Стереогарнитура обеспечивает высокое качество воспроизведения. Где бы вам ни пришлось оказаться, вы можете часами наслаждаться своей любимой музыкой. А тем, кому нужны качественные развлечения круглые сутки, W810i может предложить FM-радиоприемник с функцией RDS.', 292.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=292', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (7000, 3, 60, 23, '       Sony Ericsson M600i', 'M600i дает вам все необходимое для того чтобы непрерывно быть в активном контакте с вашими друзьями и коллегами. Он предоставляет безопасный доступ к функции push email, Интернету и локальной сети компании. Выполняйте поиск в Интернете. Загружайте музыку и видео. Наслаждайтесь динамичными играми и любимой музыкой, куда бы вы не отправлялись. С помощью M600i можно просматривать веб-ресурсы и в то же самое время звонить и принимать звонки. M600i – это настоящее многозадачное устройство третьего поколения.', 290.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=286', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6999, 3, 60, 23, '       Sony Ericsson K800i', 'Наконец-то! Цифровая камера Cyber-shot™ и маленький и совершенный мобильный телефон третьего поколения, оснащенный всеми современными функциями, теперь объединены в одном устройстве. Открой крышку объектива – и можно начинать фотографировать. Носи K800i с собой, и камера с разрешением 3,2 мегапиксела, автофокусировкой, встроенной ксеноновой вспышкой и функцией стабилизации фотографий и видеоизображений в любой момент будет у тебя под рукой. А с помощью телефона третьего поколения ты сможешь показать свои фотографии друзьям и близким. Мгновенно!', 370.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=284', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6998, 3, 60, 23, '       Sony Ericsson K790i', 'Наконец-то! Цифровая камера Cyber-shot™ и маленький и совершенный мобильный телефон стандарта EDGE, оснащенный всеми современными функциями, теперь объединены в одном устройстве. Открой крышку объектива – и можно начинать фотографировать. Носи K790i с собой, и камера с разрешением 3,2 мегапиксела, автофокусировкой, встроенной ксеноновой вспышкой и функцией стабилизации фотографий и видеоизображений в любой момент будет у тебя под рукой. А с помощью технологии EDGE можно показать свои фотографии друзьям и близким. Мгновенно!', 366.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=243', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6997, 3, 60, 23, '       Sony Ericsson K750i', 'Откройте объектив камеры K750i – и вы готовы запечатлеть интересный момент. Эта камера всегда с вами. Мобильный телефон K750i оснащен цифровой камерой с отличным качеством изображения. Если же нужно снять какое-то действие, этот телефон также способен записать качественный видеоклип.', 200.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=324', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6996, 3, 60, 23, '       Sony Ericsson K610i', 'Представляем вам небольшой и изящный телефон третьего поколения, оснащенный всем необходимым для высокоскоростного обмена сообщениями и высококачественной голосовой и видеосвязи, – K610i. Мобильный телефон Sony Ericsson K610i позволит насладиться развлекательными мультимедийными услугами, а также воспользоваться быстрым и продуктивным поиском в мобильном Интернете.', 231.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=283', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6995, 3, 4, 23, '       Samsung SGH-E900', 'SGH-E900 — это совершенное сочетание деталей черного и графитового цвета, гладкая поверхность которых так и манит прикоснуться, а обычные клавиши заменены сенсорными для того чтобы подчеркнуть минималистский дизайн. При весе всего 93 грамма и размерах 93?45 ? 16,5 мм, этот слайдер удобно лежит в руке и незаметен в кармане. Тонкий корпус и эргономичный дизайн клавиатуры, созданный специально для удобного управления одной рукой. SGH-E900 сочетает все, что необходимо, в стильном корпусе, созданным для того чтобы выглядеть превосходно.', 266.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=222', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6994, 3, 4, 23, '       Samsung SGH-X830', 'Имиджевая разработка выполнена в форм-факторе ротатор - необычном для данного производителя дизайне. Из особенностей также стоит отметить: 1 Gb встроенной памяти поддержка многих мультимедийных форматов. Спецификации: GSM 900/1800/1900, TFT дисплей (128x220 pix, 262144 оттенка), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth 1.2, USB 2.0, встроенная 1.3Megapixels камера, MP3 плеер.', 295.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1103', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6993, 3, 4, 23, '       Samsung SGH-X820', 'Samsung открывает новое измерение ультратонких телефонов с невообразимым телефоном классического дизайна и толщиной 6,9 мм, который гарантированно поместится в любом кармане. Он оснащен 2,0 Мпикс камерой и популярными мультимедиа-функциями как MP3-плеер и Bluetooth, а может еще что-то? Конечно, EDGE, 80 Мб встроенной памяти, уникальный инверсный стиль меню и многое другое. SGH-X820 первым в модельном ряду ультратонких телефонов Samsung приоткрывает завесу, за которой много инновационных стандартов, которые появятся в ближайщем будущем.', 230.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=234', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6991, 3, 4, 23, '       Samsung SGH-X670', 'SGH-X670 — привлекательный и доступный. Наслаждайся жизнью с прекрасной камерой и видеосообщениями, мобильной печатью и стерео FM-радио, заключёнными в безупречный дизайн. Приятный и простой, такой, как вы хотели', 175.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=152', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6992, 3, 4, 23, '       Samsung SGH-X680', 'Компактная имиджевая модель, сочетающая в себе мультимедиа-возможности и современный дизайн. Функционал: Tri-band GSM, 2 цветных UFB-дисплея (основной: 128x160 pix, 65K), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, USB, PC sync, E-mail, 0.3Megapixels камера (VGA, 640x480), Java MIDP 2.0, MP3 player, 35 Mb динамической памяти, диктофон, 40-тональная полифония, встроенный Hands-free.', 150.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=425', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6990, 3, 4, 23, '       Samsung SGH-P310', 'Телефон с размерами кредиnной карты Ультратонкий дизайн (толщина 8,5 мм) Металлический корпус Камера 2 Мпикс Сенсорные клавиши Слот для карт памяти microSD Просмотр офиcных документов/ТВ-выход', 435.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1097', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6989, 3, 4, 23, '       Samsung SGH-E780', 'Компактный, стильный терминал оснащенный 2.0 Megapixels камерой (1600x1200, vdeo). Раскладной корпус, толщиной 15.5 мм в сложенном состоянии, выполнен стиле Slim, на верхней панели находятся OLED-дисплей (64x80, 65K), а также клавиши управления Media-проигрывателем. Функционал: Tri-band GSM, основной дисплей: TFT (176x220 pix, 256K), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, USB, E-mail, Picsel Viewer (просмотр офисных документов), MPEG4/MP3/AAC player, Java MIDP 2.0, 80 Mb динамической памяти, 64-тональная полифония.', 255.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=416', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6988, 3, 4, 23, '       Samsung SGH-E770', 'Хороший дизайн это гармоничная комбинация формы и функциональности. Samsung SGH-E770 — отличный сплав и того и другого. Впечатляющий звук встроенного МР3-плеера заставит вас пуститься в пляс и переключать треки буквально за секунды с помощью клавиш управления МР3-плеером на внешней панели. Функция Vibetonz делает SGH-E770 уникальным в мире мультимедийных телефонов. 1,3 мегапиксельная камера Samsung SGH-E770 с 4-х кратным увеличением сделает вас настоящим мультимедиа-профессионалом. Снимите свой собственный фильм или cделайте сногшибательные фото. А затем удивите всех, показав видеоклипы и фотографии на проекторе или телевизоре, используя функцию ТВ-выход.', 228.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=199', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6987, 3, 4, 23, '       Samsung SGH-E390', 'Имиджевый аппарат выполнен в форм-факторе слайдер аналог модели E380. Оснащен 1.3Megapixels камерой и поддержкой передачи данных EDGE/GPRS. Спецификации: GSM 850/900/1800/1900, TFT дисплей (176х220 pix, 262144 оттенка), EDGE, GPRS class 10, Bluetooth 2.0 с профилем A2DP, PictBridge, SB, WAP 2.0/xHTML, Email, 1.3Megapixels камера, MP3/AAC/AAC+/MPEG4 плеер, 15 Mb встроенной памяти + слот расширения microSD.', 216.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1151', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6986, 3, 4, 23, '       Samsung SGH-E380', 'Имиджевый терминал, выполненный в раскладном форм-факторе. Телефон поддерживает различные мультимедийные форматы MP3/AAC/AAC+/WMA/AMR и выполнен в характерном для данного производителя дизайне. Спецификации: GSM 900/1800/1900, 2 цветных дисплея: основной TFT (176x220 pix, 65536 оттенков), внешний OLED (96x96 pix, 65536 оттенков), GPRS/EDGE сlass 10, WAP 2.0/xHTML, Bluetooth 2.0, USB 1.1, PC sync, E-mail, Java MIDP 2.0, 1.3Megapixels камера (1280 x 1024, video), 40 Mb встроенной памяти.', 175.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=639', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6984, 3, 4, 23, '       Samsung SGH-E570', 'Блестящий, элегантный и модный раскладной телефон SGH-E570 может быть карамельно-розовым или обладать корпусом другого столь же восхитительного цвета. Этот неотразимый телефон с камерой 1,3 Мпикс сочетает в себе свежий дизайн и превосходные технические характеристики. Красота и интеллект — все в одном.', 235.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1118', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6985, 3, 4, 23, '       Samsung SGH-E370', 'SGH-E370 это легкий компактный телефон с широким набором полезных функций: 1,3 Мпикс камера (с возможностью записи 1 ч видео) со вспышкой, EDGE, GPRS класс 10 и яркий TFT-дисплей 65536 цветов завершает картину. Мультимедия возможности включают MP3/Видео плеер, отдельный динамик и громкую свзяь.', 193.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=194', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6983, 3, 4, 23, '       Samsung SGH-E500 White', 'Имиджевый Tri-band аппарат, выполненный в раскладном форм-факторе и рассчитан на женскую аудиторию. Спецификации: 2 цветных дисплея: основной TFT(176х220 pix, 262144 оттенка), внешний OLED (80x64 pix, 65536 оттенков), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, USB, PC sync, встроенная 1.3Megapixels камера, MP3 плеер, 80 Mb встроенной памяти.', 270.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1064', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6982, 3, 4, 23, '       Samsung SGH-E500 Gold brown', 'Имиджевый Tri-band аппарат, выполненный в раскладном форм-факторе и рассчитан на женскую аудиторию. Спецификации: 2 цветных дисплея: основной TFT(176х220 pix, 262144 оттенка), внешний OLED (80x64 pix, 65536 оттенков), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, USB, PC sync, встроенная 1.3Megapixels камера, MP3 плеер, 80 Mb встроенной памяти.', 320.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=937', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6979, 3, 4, 23, '       Samsung SGH-D830', 'Очередной имиджевый продукт из новой серии ультратонких мобильных устройств от Samsung Electronics, выполненный в раскладном корпусе толщиной 9.9 мм. Функционал: GSM 900/1800/1900, 2 дисплея (основной: TFT, 240x320 pix, 256K; внешний: LCD-монохромный, 96x16 pix), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, USB, поддержка приложений Microsoft Office, 2.0Megapixels камера (1600х1200, autofocus, video), Java MIDP 2.0, MPEG4/MP3/WMA/AAC(+) player, 80 Mb динамической памяти + слот расширения microSD/TransFlash, TV-out, 64-тональная полифония.', 290.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=634', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6980, 3, 4, 23, '       Samsung SGH-D840', 'Утончнные линии, скошенные грани и законченность образа — вот черты, присущие дизайну мобильных телефонов Samsung и секреты впечатляющей внешности D840. Отделка серебром придаёт шарма и привлекательности этому тонкому гладкому мобильному телефону в простом и эргономичном корпусе.', 430.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1133', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6981, 3, 4, 23, '       Samsung SGH-D900', '!!!Bluetooth гарнитура с картой памяти в комплекте!!!.Мультимедийный бизнес-аппарат, оснащенный 3.2Megapixels камерой (2048x1536, video, autofocus) со вспышкой. Исполнение корпуса - &quot;слайдер&quot; в стиле Slim, толщина в закрытом состоянии - 13 мм. Спецификации: Tri-band, QVGA TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth 1.2 с поддержкой PictBridge, USB, PC sync, E-mail, Java MIDP 2.0, возможность просмотра офисных документов, TV-выход, MPEG4/WMA/MP3/AAC(+) player, 80 Mb динамической памяти + слот расширения microSD/TransFlash, 64-тональная полифония.', 385.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=636', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6978, 3, 4, 23, '       Samsung SGH-D820', 'Samsung SGH-D820 — это совершенный телефон в ультратонком дизайне. Полированная черная отделка корпуса подчеркивает уверенность и стиль, а функциональность просто поражает воображение. Толщиной всего 14,8 мм, SGH-D820 удобно лежит в руке. Одно лишь прикосновение открывает перед вами все возможности данной модели.', 264.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=192', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6977, 3, 4, 23, '       Samsung SGH-D800', 'Оцените притягательность Samsung SGH-D800! Матовый черный корпус с хромированными вставками, использование раздвижной конструкции и небольшие размеры (97?52?14,9 мм) создают стильный образ, который, наверняка, привлечет внимание окружающих. Помимо элегантного внешнего вида, этот телефон обладает широкими функциональными возможностями. Делайте снимки с помощью встроенной камеры (1,3 Мпикс), рассматривайте их на цветном дисплее (240?230 пикс.), отправляйте на принтер с помощью Bluetooth PictBridge и наслаждайтесь высококачественными отпечатками.', 245.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=191', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6975, 3, 4, 23, '       Samsung SGH-D600', 'Дизайн премиум-класса, элегантный раздвижной корпус и набор самых современных функций — все это делает D600 совершенным инструментом для бизнеса. 2.0 мегапиксельная камера D600 позволяет делать высококачественные снимки с разрешением 1600?1200 пикселей. Этих характеристик достаточно для распечатки фотографий привычного нам размера 10?15. Для достижения высокого качества изображения и удобства просмотра D600 оснащен большим (5.04 см) TFT-дисплеем 262,144 цветов c разрешением 240?320 пикселей (QVGA).', 263.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=189', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6976, 3, 4, 23, '       Samsung SGH-D720', 'SGH-D720 хороший помощник в бизнесе. Многозадачная операционная система, высокое быстродействие, 1,3 мегапиксельная камера и беспроводная печать по Bluetooth всегда у вас под рукой для выполнения поставленных задач', 292.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=130', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6974, 3, 8, 23, '       Nokia 7390', 'Тонкий и изящный телефон с раскладным корпусом. Основной QVGA-дисплей, отображающий до 16 млн цветов, и дополнительный дисплей, способный отобразить до 262 144 цветов. Камера (3 Мпикс) автофокусом и встроенной вспышкой. Видеовызовы с высокой скоростью передачи данных и потоковая передача видео в сетях 3G. Встроенный музыкальный стереопроигрыватель и FM-радио', 415.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1105', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6973, 3, 8, 23, '       Nokia N70 Music Edition', 'Возьмите музыку в дорогу. Ваш личный аудиоплеер, постоянный фото-компаньон и умный мультимедийный компьютер — все в одном устройстве. Благодаря Nokia N70 Music Edition музыка всегда с вами. Почувствуйте мелодию. Благодаря карте памяти объемом 1 Гбайт в вашем кармане уместится до 700*композиций, с которыми вы будете танцевать до упаду. С легкостью переключайтесь между музыкой и телефонными вызовами, а если вам захочется сменить мелодию, откройте для себя новую музыку со встроенным стерео FM-радио, поддерживающим Visual Radio.', 350.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1106', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6972, 3, 8, 23, '       Nokia N93', 'Мультимедийное устройство нового поколения, выполненное в раскладном форм-факторе, аналогичное решение использовано в Nokia N92. Функционал: Symbian OS v9.1, WCDMA 2100/ GSM 850/900/1800/1900, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 11, WAP 2.0/HTML, Wi-Fi (802.11i b/g), Bluetooth 2.0 с поддержкой PictBridge, IrDA, USB 2.0, поддержка приложений Microsoft Office и сервисов Nokia Xpress, Push-to-talk, 3.2Megapixels (2048x1536 pix; оптика Carl Zeiss, объектив Tessar) + VGA Video-call камера, TV out, RealOne player, stereo FM-тюнер (Visual Radio), 50 Mb динамической памяти + слот расширения miniSD, 64-тональная полифония. ', 685.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=916', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6971, 3, 8, 23, '       Nokia N91 Music Edition', 'Будьте хозяином своих мелодий с 8 ГБ чистого высококачественного стереозвука. Снимайте превосходные фотографии 2-мегапиксельной камерой и наслаждайтесь богатыми возможностями мобильного Интернета. Nokia N91 8 ГБ с музыкальным проигрывателем — ваш новый музыкальный компаньон. Благодаря встроенному жесткому диску емкостью 8 Гбайт этот мультимедийный компьютер может хранить до 6 000* композиций. Зачем выбирать отдельные песни, если вы можете взять с собой всю свою музыкальную коллекцию? Оставайтесь вместе с друзьями и любимыми мелодиями с помощью Nokia N91 8 ГБ.', 650.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1116', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6969, 3, 8, 23, '       Nokia N90', 'Мультимедийное устройство серии Nokia Nseries, работающее под управлением Symbian OS 8.1a и выполненное в оригинальном раскладном форм-факторе. Особенности: UMTS/GSM 900/1800/1900, EDGE/GPRS class 10, поворотный TFT-дисплей (262144 оттенка), 2.0Megapixels камера (оптика Carl Zeiss), Bluetooth v2.0, MP3/AAC/MPEG4 player, 31 Mb динамической памяти + слот расширения RS-MMC.', 477.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=319', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6970, 3, 8, 23, '       Nokia N91', 'Высокофункциональная разработка из серии Nokia Nseries под управлением Symbian OS v9.1, ориентированная на мобильных меломанов. Главная особенность - 4 Gb жесткий диск, а также поддержка WCDMA/EDGE/GPRS/GSM 900/1800/1900, Wi-Fi, Bluetooth 1.2, MPEG4/MP3/WAV/AAC(+) player, 2.0Megapixels камера (оптика Carl Zeiss), stereo FM radio, аудиоразъем совместимый с большинством акустических аксессуаров (mini-jack port 3.5 mm).', 495.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=401', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6968, 3, 8, 23, '       Nokia N80', 'Расслабьтесь и наслаждайтесь 1 500* песнями на карте памяти формата miniSD объемом 2 ГБ. Будьте в курсе новейшей музыки благодаря FM-радио. Музыка создана, чтобы слушать ее всем вместе, поэтому воспользуйтесь встроенными стереодинамиками и устройте вечеринку с друзьями.', 482.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=256', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6966, 3, 8, 23, '       Nokia N73', 'Высокотехнологичный 3G-смартфон на платформе Symbian OS v9.1, оснащенный 3.2 Megapixels камерой (2048x1536 pix; оптика Carl Zeiss, объектив Tessar; VGA Video-call камера). Спецификации: WCDMA2100/ GSM 850/900/1800/1900, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 11, WAP 2.0/HTML, Bluetooth 2.0 с поддержкой PictBridge, USB 2.0, поддержка приложений Microsoft Office и сервисов Nokia Xpress, Push-to-talk, RealOne player, stereo FM-тюнер (Visual Radio), 42 Mb динамической памяти + слот расширения miniSD, 64-тональная полифония/ 3D stereo.', 485.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=905', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6967, 3, 8, 23, '       Nokia N73 Music Edition', 'Слушайте дольше. Покупайте новую музыку в движении, быстро синхронизируйтесь с совместимым ПК и слушайте любимые мелодии с удобством. Представляем Nokia N73 Music Edition.', 585.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1096', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6965, 3, 8, 23, '       Nokia N72 Black', 'Мультимейдийное устройство из модельного ряда Nseries, имиджевый смартфон под управлением Symbian OS v8.1a. Исполнение корпуса - &quot;моноблок&quot;, доступны 2 цветовых решения: Gloss Black и Pearl Pink. Функционал: Tri-band GSM, TFT-дисплей (176x208 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, USB 2.0, Push-to-talk, 2.0Megapixels (20x zoom,1200x1600, video), RealOne player, stereo FM-тюнер (Visual Radio), 20 Mb динамической памяти + слот расширения RS-MMC/MMCmobile, 64-тональная полифония, поддержка сервисов Nokia Xpress, расширенные возможности персонализации.', 325.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1092', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6964, 3, 8, 23, '       Nokia N72 Pink', 'Мультимейдийное устройство из модельного ряда Nseries, имиджевый смартфон под управлением Symbian OS v8.1a. Исполнение корпуса - &quot;моноблок&quot;, доступны 2 цветовых решения: Gloss Black и Pearl Pink. Функционал: Tri-band GSM, TFT-дисплей (176x208 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, USB 2.0, Push-to-talk, 2.0Megapixels (20x zoom,1200x1600, video), RealOne player, stereo FM-тюнер (Visual Radio), 20 Mb динамической памяти + слот расширения RS-MMC/MMCmobile, 64-тональная полифония, поддержка сервисов Nokia Xpress, расширенные возможности персонализации.', 320.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=571', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6962, 3, 8, 23, '       Nokia N70', 'Компактный 3G-смартфон под управлением Symbian OS 8.1a, входящий в линейку мощных мультимедийных устройств Nokia Nseries. Функционал: GSM 900/1800/1900/UMTS/EDGE/GPRS class 10, WAP 2.0/xHTML, TFT-дисплей 256K, 2.0Megapixels + дополнительная VGA Video-Call камера, MP3/AAC/MPEG4, stereo FM radio, Bluetooth 1.2, Push to talk, RealOne player, 21 Mb динамической памяти + слот расширения (MMCmobile).', 310.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=117', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6963, 3, 8, 23, '       Nokia N71', 'Представитель линейки высокотехнологичных продуктов нового поколения Nseries, 3G-cмартфон под управлением Symbian OS v9.1 выполненный в раскладном корпусе. Оснащение: WCDMA 2100/ GSM 900/1800/1900, 2 TFT-дисплея (основной: QVGA, 240x320 pix, 256K; внешний: 96x68 pix, 65K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 1.2, IrDA, USB 2.0, Push-to-talk, 2.0Megapixels (20x zoom,1200x1600, video) + VGA Video-call камера, RealOne player, stereo FM-тюнер (Visual Radio), 10 Mb динамической памяти + слот расширения miniSD (до 2 Gb), 64-тональная полифония, поддержка сервисов Nokia Xpress.', 370.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=253', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6961, 3, 8, 23, '       Nokia E70', 'Раширение модельного ряда E, ориентированное на бизнес-пользователей. Смартфон под управлением Symbian OS 9.1, выполненный в форм факторе &quot;моноблок&quot; и оснащенный раскладной QWERTY-клавиатурой (аналогичное решение было применено ранее в моделях Nokia серии 68XX). Функционал: UMTS/ Tri-band GSM, TFT-дисплей (352x416 pix, 16 млн. цветов), EDGE/GPRS class 10, WAP 2.0/HTML, E-mail (поддержка Blackberry, Visto), Wi-Fi (802.11i/e/g), Bluetooth 1.2, IrDA, USB 2.0, поддержка приложений Microsoft Office, Push-to-talk, 2.0Megapixels (1200x1600, video) + CIF Video-call камера, RealOne player, 65 Mb динамической памяти + слот расширения miniSD.', 475.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=400', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6960, 3, 8, 23, '       Nokia E61', 'Многофункциональный продукт бизнес-класса, оснащенный полноценной QWERTY-клавиатурой, обеспечивающей комфортную работу с E-mail. Форм-фактор Nokia E61 - моноблок, корпус выполнен из высококачественного металла. Спецификации: Symbian OS 9.1, WCDMA 2100/ GSM 850/900/1800/1900, TFT-дисплей (320x240 pix, 16 млн. цветов), EDGE/GPRS class 11, WAP 2.0/HTML, E-mail (поддержка Blackberry, Visto), Wi-Fi (802.11i/e/g), Bluetooth 1.2, IrDA, USB 2.0, Push-to-talk, RealOne player, 64 Mb динамической памяти + слот расширения miniSD, интеграция и синхронизация с существующими бизнес-инструментами и приложениями.', 435.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=255', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6959, 3, 8, 23, '       Nokia E60', 'Представитель новой линейки 3G-аппаратов, призванный обеспечить соответствие корпоративной политике безопасности компаний, запрещающих использовать своим служащими камерафоны. Функционал и возможности: платформа Symbian OS 9.1, WCDMA 2100/ GSM 900/1800/1900, TFT-дисплей (352x416 pix, 16 млн. цветов), EDGE/GPRS class 10, WAP 2.0/HTML, E-mail, Wi-Fi (802.11i/e/g), Bluetooth 1.2, IrDA, USB 2.0, Push-to-talk, RealOne player, 64 Mb динамической памяти + слот расширения RS-MMC DV/ MMCmobile, интеграция и синхронизация с существующими бизнес-инструментами и приложениями.', 360.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=254', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6958, 3, 8, 23, '       Nokia E50-2', 'Модифицированная версия Symbian-смартфона Nokia E50, призванная обеспечить &quot;соответствие корпоративной политике безопасности компаний, запрещающих использовать своим служащими камерафоны&quot;. Ключевое отличие от базовой модели - отсутствие встроенной фотокамеры. Функционал: Symbian OS v9.1, Quad-band GSM, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, IrDA, Push to talk, Email (поддержка BlackBerry), просмотр приложений Microsoft Office/Adobe Reader, RealOne player, 70 Mb динамической памяти + слот расширения TransFlash/ microSD.', 240.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=938', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6957, 3, 8, 23, '       Nokia E50-1 Metal Black', 'Symbian-смартфон классического дизайна, ориентированный на бизнес пользователей. Благодаря решению Avaya one-X Mobile Edition (приобретается отдельно), обладающий расширенными функциями голосовой связи: совместное использование мобильного и стационарного телефона (мобильное подключение к УПАТС). Прочие спецификации: Symbian OS v9.1, Quad-band GSM, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, IrDA, Push to talk, Email (поддержка BlackBerry), просмотр приложений Microsoft Office/Adobe Reader, RealOne player, 1.3Megapixels камера (1280x960, video), 70 Mb динамической памяти + слот расширения TransFlash/ microSD.', 280.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1099', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6956, 3, 8, 23, '       Nokia E50-1 Camera', 'Symbian-смартфон классического дизайна, ориентированный на бизнес пользователей. Благодаря решению Avaya one-X Mobile Edition (приобретается отдельно), обладающий расширенными функциями голосовой связи: совместное использование мобильного и стационарного телефона (мобильное подключение к УПАТС). Прочие спецификации: Symbian OS v9.1, Quad-band GSM, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, IrDA, Push to talk, Email (поддержка BlackBerry), просмотр приложений Microsoft Office/Adobe Reader, RealOne player, 1.3Megapixels камера (1280x960, video), 70 Mb динамической памяти + слот расширения TransFlash/ microSD.', 255.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=939', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6955, 3, 8, 23, '       Nokia 8800 Sirocco Edition Dark', 'Очередная дизайнерская модификация популярной имиджевой модели Nokia 8800. Функциональные возможности, по сравнению с базовой разработкой, отличаются рядом улучшений: 2.0Megapixels камера (8x zoom, 1600x1200), обновленная версия Bluetooth 2.0, динамическая память увеличена до 128 Mb. Помимо &quot;косметических&quot; изменений стоит отметить наличие уникального контента - звуковое сопровождение написанное авангардным музыкантом Brian Eno. В продажу данная модель поступит в 2 цветовых вариантах: Sirocco Edition Dark и Light.', 999.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1033', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6954, 3, 8, 23, '       Nokia 8800 Sirocco Edition Light', 'Имиджевая модель Premium-класса, представляющая собой логическое развитие для бестселлера Nokia 8800. Технические характеристики, по сравнению с предшественницей, имеют ряд улучшений: 2.0Megapixels камера (8x zoom, 1600x1200), обновленная версия Bluetooth 2.0, динамическая память увеличена до 128 Mb. Кроме обновленного дизайна и технических усовершенствований стоит отметить наличие уникального контента - звуковое сопровождение написанное авангардным музыкантом Brian Eno. В продажу данная модель поступит в 2 цветовых вариантах: Sirocco Edition Dark и Light.', 959.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1024', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6953, 3, 8, 23, '       Nokia 8800 Silver', 'Изысканная high-end разработка Premium-класса, slide-корпус со скользящим механизмом раскрытия выполнен из нержавеющей стали. Оснащение: GSM/GPRS/EDGE, TFT-дисплей 256K, SVGA-камера (0.5Megapix, 800x600), Bluetooth, stereo FM-тюнер, 64-тональная полифония (звуковое сопровождение от Ryuichi Sakamoto), поддержка MP3/AAC, 64 Mb динамической памяти.', 595.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=119', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6952, 3, 8, 23, '       Nokia 8800 Gun Metal Special Edition', 'Дизайнерская модификация имиджевого мобильного телефона премиум-класса Nokia 8800, выпущеная ограниченной партией. Особенности новинки: новое цветовое исполнение и фактура поверхности корпуса из нержавеющей стали - Gun Metal Special Edition, о чем, собственно, дает понять и само название данной модели.', 634.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=843', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6951, 3, 8, 23, '       Nokia 7373', 'Очередное пополнение коллекции Fashion-телефонов L’Amour, представляющее собой логическое развитие модели Nokia 7370. Раздвижной корпус 7373 с тисненой отделкой и изысканным декором выполнен в дизайне &quot;Rotator&quot;, доступные цветовые решения: Bronze black и Powder pink. Функционал: GSM 900/1800/1900, TFT-дисплей (240x320 pix, 256K), EDGE/GPRS class 10, WAP 2.0/xHTML, E-mail, Bluetooth 2.0, USB, 2.0Megapixels камера (8x zoom, 1600x1200, video), Java MIDP 2.0, MP3/AAC/M4A/eAAC(+) player, stereo FM radio, 8 Mb динамической памяти + слот расширения microSD/ TransFlash (до 2 Gb), 64-тональная полифония.', 310.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1102', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6950, 3, 8, 23, '       Nokia 6288', 'Имиджевый 3G камерафон бизнес класса выполнен в форм-факторе слайдер. Данная модель оснащена двумя камерами, поддерживает технологию EDGE class 10 и предназначена для работы в сетях UMTS/GSM 900/1800/1900. Спецификации: TFT дисплей (240х320 pix, 262144 оттенка), EDGE/GPRS class 10, WAP 2.0/xHTML, USB 2.0, Bluetooth 2.0/PictBridge, основная 2.0Megapixels камера, VGA Video-Call камера, 5 Mb встроенной памяти + слот расширения miniSD.', 320.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1081', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6949, 3, 8, 23, '       Nokia 6280', 'Бизнес-модель поддерживающая работу в 3G-сетях, корпус выполнен в форм-факторе слайдер. Оснащение: GSM 900/1800/1900/WCDMA 2100, поддержка EDGE/GPRS/HSCSD, TFT-дисплей (240x320 pix, 256K), Bluetooth, IrDA, Push to Talk, 2Megapixel камера, 10 Mb динамической памяти + слот расширения miniSD, MP3/AAC/MPEG4 player, Java 2.0.', 295.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=396', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6947, 3, 8, 23, '       Nokia 6230i', 'Бизнес-терминал, усовершенствованная версия популярной EDGE-модели Nokia 6230, использует тот же дизайн, изменения незначительны. Основные отличия: TFT-дисплей (208х208 pix, 65536 оттенков), 1.3Megapixel камера (запись видео), поддержка Visual Radio, Push to talk, 32 Mb динамической памяти (расширение до 1 Gb), 5-позиционный джойстик.', 223.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=395', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6948, 3, 8, 23, '       Nokia 6233', 'Компактный 3G-терминал, обладающий широкими мультимедийными возможностями и оригинальным дизайном от Nokia. По сути данный аппарат представляет собой логическое развитие для бизнес-модели Nokia 6230. Функционал: Tri-band GSM/ UMTS, TFT-дисплей (QVGA, 240x320 pix; 256K), GPRS class 10, WAP 2.0/xHTML, Bluetooth 2.0 (поддержка PictBridge), IrDA, USB, E-mail, Push to talk, 2.0Megapixels (8x zoom,1200x1600, video), 70 Mb динамической памяти + слот расширения microSD/TransFlash (до 2 Gb), Java MIDP 2.0, MPEG4/MP3/MP4/AAC(+) player, stereo FM radio (Visual Radio), 64-тональная полифония/ 3D sound. ', 270.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=564', 0.00, 0.00, 'Уточняйте');
