INSERT INTO `goods` VALUES (6946, 3, 8, 23, '       Nokia 6131', 'Мультимейдиный терминал среднего класса, выполненный в раскладном корпусе. Первая модель от Nokia, оснащенная QVGA-дисплеем отображающим 16 777216 оттенков. Спецификации: GSM 850/900/1800/1900, EDGE/GPRS class 10, 2 TFT-дисплея (основной: 320x240 pix, 16 млн. цветов; внешний: 126x160 pix, 256K), WAP 2.0/xHTML, Bluetooth (поддержка PictBridge), IrDA, USB 1.1, MMS/E-mail, 1.3 Megapixels камера (8x zoom, 1280x960, video), Push-to-talk, Java MIDP 2.0, MPEG4/MP3/MP4/AAC(+)/WMA player, stereo FM radio (Visual Radio), 11 Mb динамической памяти + слот расширения microSD/TransFlash, 64-тональная полифония.', 250.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=705', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6944, 3, 8, 23, '       Nokia 6125', 'Имиджевый аппарат среднего сегмента, раскладной корпус выполнен в традиционном, для продуктов данного производителя, стиле. Функционал: Quad-band GSM, EDGE/GPRS class 10, HSCSD, 2 цветных дисплея(основной: TFT, 128x160 pix, 256K), WAP 2.0/xHTML, Bluetooth 2.0, IrDA, USB 1.1, MMS/E-mail, 1.3 Megapixels камера (8x zoom, 1280x1024, video), Push-to-talk, Java MIDP 2.0, Macromedia Flash 1.1, MPEG4/MP3/MP4/AAC(+)/WMA player, stereo FM radio, 11 Mb динамической памяти + слот расширения microSD/TransFlash, диктофон, 24-тональная полифония.', 200.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=242', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6945, 3, 8, 23, '       Nokia 6151', '3G-терминал выполнен в форм-факторе классический моноблок и относится к бизнес классу. Телефон оснащен 1.3Megapixels камерой с 4-кратным цифровым увеличением и режимом горизонтальной ориентации кадра. Функционал: GSM 900/1800/1900, 3G (WCDMA 2100), TFT дисплей (128x160 pix, 262144 оттенка), 30 Mb встроенной памяти, поддержка карт памяти стандарта microSD/TransFlash, XVGA (1280 x 960, video CQIF, 1.3 Megapixels, 4-x zoom).', 195.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1079', 0.00, 0.00, 'Уточняйте');
