INSERT INTO `goods` VALUES (6943, 3, 8, 23, '       Nokia 6111', 'Имиджевый камерафон, стильный дизайн корпуса реализован в модном форм-факторе &quot;слайдер&quot;. Прочее: Tri-band, TFT-дисплей (262144 оттенка), GPRS/EDGE/HSCSD, Push-to-talk, Bluetooth, IrDA, 1.0Megapix камера (6x zoom, 1152х864, video) со вспышкой, MP3/AAC/MPEG4 player, stereo FM-radio, Java (3D-игры), 23 Mb динамической памяти, 64-тональная полифония.', 220.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=118', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6940, 3, 8, 23, '       Nokia 5500 Sport XpressMusic', 'Музыкальная версия Symbian-смартфона Nokia 5500 Sport, отличающаяся расширенным набором музыкальных функций, обновленной комплектацией и новым цветовым исполнением корпуса. В стандартный комплект поставки Nokia 5500 Sport Xpress Music входят: карта памяти microSD объемом 512 Mb, специальное крепление для ношения телефона на талии или руке во время занятий спортом, велосипедное крепление, спортивная гарнитура, а таже программное обеспечение Nokia Music Manager.', 260.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1094', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6942, 3, 8, 23, '       Nokia 5300 XpressMusic', 'Габариты и вес: 92.4x48.2x20.7 мм, 106 гр Дисплей: 320x240 точек, 262144 цветов Звук: 64-тональная Полифония, MIDI, MP3, AAC, Запись мелодий, Громкая связь, fm-приемник, Диктофон Память: тел. книга на 1000 ячеек, Разъем карты памяти Фото-камера: Видео-камера: Bluetooth: GPRS: EDGE: Аккумулятор: Li-Ion (BL-5B) 860 мА*ч Время разговора до: 3.0 ч Время ожидания до: 250.0 ч Стандарты связи: GSM 900/1800/1900', 250.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1078', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6941, 3, 8, 23, '       Nokia 5200', 'Отличное качество звучания вашей любимой музыки. Возможность загружать музыку прямо на ходу. Оригинальный компактный телефон, созданный для города. Стильный раздвижной корпус с механизмом доводки. MP3-проигрыватель и стерео-FM-радио. Мелодии вызова в формате MP3, мелодии вызова, уведомления и звуки в играх в форматах True Tone и MIDI с полифонией до 64 голосов, видеоклипы в качестве сигнала вызова.', 175.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1095', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6939, 3, 8, 23, '       Nokia 5500 Sport', 'Имиджевый смартфон на базе Symbian OS 9.1, позиционируется как спортивная модель предназначенная для пользователей ведущих активный образ жизни. Пылевлагозащищеный моноблочный корпус выполнен с применением элементов из нержавеющей стали. Функционал: Tri-band GSM, TFT дисплей (208х208 pix, 256K), EDGE/GPRS class 10, WAP 2.0/HTML, Bluetooth 2.0, IrDA, Push to talk, MP3/AAC/MPEG4 player, stereo FM radio, приложение Quick Start (секундомер, шагомер, измеритель скорости и пройденной дистанции, сожженных калорий), 2.0Megapixels камера (1600x1200, video), 64 Mb встроенной памяти + слот расширения microSD/TransFlash.', 235.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=841', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6938, 3, 8, 23, '       Nokia 3250 XpressMusic', 'Обновленная и усовершенствованная версия музыкального Symbian-смартфона Nokia 3250, расширяющая линейку мультимедийных устройств ориентированных молодежную аудиторию. Ключевые отличия от модели-предшественницы: расширенная комплектация включающая карту памяти microSD объемом 1 Gb (расширение до 2 Gb), улучшенные функциональные характеристики, а также новые цветовые решения корпуса (White-Red, White-Grey, Silver, Black, Pink).', 325.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1093', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6933, 13, 414, 23, '       Sony Ericsson HBH-IV835', 'Беспроводная телефонная гарнитура Sony Ericsson HBH-IV835 оснащена системой цифровой обработки сигналов Digital Signal Processing, которая обеспечивает высокое качества звука. Гарнитура также оснащена функцией Auto pairing (автоматическое парное соединение). Функционал: Функционал: Bluetooth 2.0 с профилями Hands-Free и Headset. Время работы в режиме разговоров до 3.5 часов, в режиме ожидания до 160 часов.', 83.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=612', 0.00, 0.00, 'Уточняйте');
