INSERT INTO `goods` VALUES (6937, 3, 8, 23, '       Nokia 3250', 'Музыкальный смартфон на базе Symbian OS v9.1, прямой конкурент продуктов серий Walkman и ROKR. Позиционируется производителем как &quot;3 устройства в 1&quot;, нижняя часть корпуса оснащена поворотным механизмом (-90 и +180°), для перехода в режим камерафона или медиа-плеер. Функционал: Tri-band GSM, TFT-дисплей (176x208, 256K), EDGE/GPRS class 10, WAP 2.0/xHTML, Bluetooth, Push to Talk, E-mail, 2.0 Megapixels камера, MP3/eAAC+/MPEG4/WMA/RealOne player, Stereo FM radio, 10 Mb динамической памяти + слот расширения microSD/TransFlash (до 1 Gb).', 280.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=317', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (4080, 3, 60, 16, 'Ericsson', 'Стандарт: GSM 900/1800, Размеры, мм: 102 x 44 x 18, Дисплей: STN 65536 цветов, Разрешение дисплея: 128х128 пикселей, Цифровая камера: Камера непредусмотрена, Видео: Нет, Интернет: Нет, Телефонная книга: Макс. 500 абонентов, Карта памяти: Нет', 69.99, 0.00, 12, '2007-02-04', 'www.koshik.com.ua/shop/8/1/278.html', 0.00, 0.00, 'Нет');
INSERT INTO `goods` VALUES (6936, 13, 414, 23, '       Sony Ericsson HBH-DS970', 'Особенность стерео гарнитуры HBH-DS970 от Sony Ericsson серии Walkman - возможность беспроводного соединения одновременно с 2 устройствами, что обеспечивает доступ к музыкальным файлам, хранящимся на ПК, карманном компьютере или другом устройстве, поддерживающем Bluetooth. Функционал: Bluetooth 2.0 с профилями Hands-Free/ Headset, время работы в режиме разговора/ прослушивания: до 6 часов, в режиме ожидания: до 300 часов', 116.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=935', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6935, 13, 414, 23, '       Sony Ericsson HBH-PV705', 'HBH-PV705 так хороша, что кажется нереальной. При весе всего 14 грамм эта беспроводная гарнитура способна работать 12 часов в режиме разговора и 300 часов в режиме ожидания. Она обеспечивает по-настоящему исключительное время работы, несмотря на свой компактный дизайн, выполненный в сдержанных, но стильных тонах. Она настолько легка, что может постоянно находиться на твоем ухе, поскольку благодаря исключительному времени работы ее можно использовать целый день; или же она может висеть на шее на прилагаемом шнурке.', 26.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1110', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6932, 13, 414, 23, '       Sony Ericsson HBH-GV435', 'Беспроводная телефонная гарнитура HBH-GV435 выполнена в оригинальном дизайне от Sony Ericsson. Гарнитура оснащена системой цифровой обработки сигналов Digital Signal Processing, обеспечивает высокое качество звука. Гарнитура также оснащена функцией Auto pairing (автоматическое парное соединение). Функционал: Bluetooth 2.0 с профилями Hands-Free и Headset. Время работы в режиме разговоров до 8 часов, в режиме ожидания до 300 часов.', 75.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=936', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6931, 13, 414, 23, '       Sony Ericsson HBH-610a', 'Беспроводная гарнитура Sony Ericsson HBH-610a – усовершенствованная версия модели HBH-610. Основное отличие гарнитуры HBH-610a заключается в поддержке технологии Auto pairing которая позволяет подключить гарнитуру без ввода PIN-кода. Функционал: поддержка протокола Bluetooth 2.0 и профилей Headset/ Hands-Free, Li-Pol аккумулятор увеличенной емкости, обеспечивающий время работы в режиме разговоров до 6.5 ч, в режиме ожидания до 300 ч, максимальный радиус устойчивой связи до 10 метров.', 69.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=615', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6929, 13, 12, 23, '       Plantronics Voyager 510', 'Эргономичная гарнитура, оснащенная поворотным динамиком и держателем микрофона с системой шумоподавления. Поддерживает спецификацию Bluetooth 1.2 c профилями Headset/ Hands-Free. Может быть использована совместно с Bluetooth адаптером Voyager 510s, с возможностью подключения практически к любому проводному телефонному аппарату, превращая его в Bluetooth телефон, что позволяет использовать 510 для работы одновременно с офисным и мобильным телефонами.', 65.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=654', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6930, 13, 414, 23, '       Sony Ericsson HBH-610', 'Высокотехнологичная Bluetooth гарнитура классического дизайна, выполненная в строгом стиле. Функционал: поддержка протокола Bluetooth 2.0 и профилей Headset/ Hands-Free, цифровая обработка сигнала (DSP), Li-Pol аккумулятор увеличенной емкости, обеспечивающий время работы в режиме разговоров до 6.5 ч, в режиме ожидания до 300 ч, максимальный радиус устойчивой связи до 10 метров, вес 20 г.', 68.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=613', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6928, 13, 12, 23, '       Plantronics Explorer 320', 'Строгая гарнитура классического дизайна, использующая Bluetooth-протокол 1.2 и поддерживающая профили Headset и Hands-Free. Время работы в режиме разговора до 10 часов, в режиме ожидания до 240 часов. Оснащена многофункциональным эргономичным джойстиком и функцией Mute (отключение микрофона). Максимальная дальность устойчивой связи до 10 метров.', 47.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=652', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6927, 13, 12, 23, '       Plantronics Discovery 640', 'Гарнитура премиум класса в оригинальном дизайне от Plantronics. Из особенностей можно отметить поддержку технологии Multipoint (работа с несколькими Bluetooth устройствами одновременно), длительное время автономной работы: до 15 часов в режиме разговора и до 180 часов в режиме ожидания при использовании адаптера с батареей AAA, а также наличие переходников для подзарядки от мобильного телефона (Sony Ericsson, Nokia, Motorola, Siemens) в комплекте поставки.', 86.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=653', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6926, 13, 8, 23, '       Nokia HS-36W', 'Компактная беспроводная гарнитура с оригинальным дизайном от Nokia. Спецификация Bluetooth 1.2 с профилями Hands-Free и Headset. Оснащена литиево-полимерным аккумулятором, который позволяет гарнитуре до 6 часов работать в режиме разговора и до 110 часов в режиме ожидания. Вес гарнитуры 20 грамм, размеры 65x25x22 мм.', 46.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=646', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6925, 13, 8, 23, '       Nokia HS-26W', 'Унивесальная Bluetooth-гарнитура, выполненная в классическом стиле. Данная разработка поддерживает самый передовой, на текущий момент протокол беспроводной сязи Bluetooth 2.0 с профилями Hands-Free 1.0 / Headset 1.1. Nokia HS-26W снабжена голосовым набором, клавишами отключения микрофона и регулировки громкости. Батарея Ni-MH 130 mAh позволяет работать до 5 часов в режиме разговора и до 150 часов в режиме ожидания', 44.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=645', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6924, 13, 8, 23, '       Nokia HS-13W', 'Fashion-продукт а стиле &quot;арт-деко&quot;, предназначенный в первую очередь для использования в качестве дополнительного аксессуара к модели Nokia 7280. Особенности: хромированный корпус с прикрепленным наушником, 5-позиционный джойстик, цветной дисплей (128х128 pix) отображающий до 4096 цветов, 500 Kb динамической памяти. Спецификация Bluetooth 1.1, поддерживаемый профиль: Hands-free.', 135.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=644', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6923, 13, 8, 23, '       Nokia HS-12W', 'Nokia HS-12W беспроводная стерео гарнитура позволяет прослушивать музыку и отвечать на звонки, гарнитура автоматически останавливает музыку при получении вызова и снова включает воспроизведение по его окончании. Снабжена дисплеем который отображает название текущей музыкальной записи или воспроизводимого радиоканала. Функционал: оснащена Bluetooth 1.1 с профилями Hands-Free и Headset. Время работы в режиме разговора до 8 часов и до 200 часов в режиме ожидания.', 135.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=909', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6922, 13, 8, 23, '       Nokia BH-900', 'Беспроводная гарнитура Nokia BH-900 оснащена выдвижным микрофоном, с функцией снижения шума и подавления эха, а также удержание вызова, отключение микрофона, голосовой набор, повторный набор. Функционал: Bluetooth 2.0 с профилями Hands-Free и Headset. Литиево-полимерный аккумулятор емкостью 160 mAh позволяет гарнитуре работать до 8 часов в режиме разговора и до 180 часов в режиме ожидания.', 90.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=641', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6921, 13, 8, 23, '       Nokia BH-801', 'Стильный вид Bluetooth-гарнитуры Nokia BH-801 соответствует ее высокому качеству и свидетельствует об инновационном дизайнерском подходе. Эта приятно простая модель подключается к вашему телефону с помощью беспроводной технологии Bluetooth и поставляется с элегантной лентой для ношения на шее и практичным поясным зажимом, благодаря которому гарнитура всегда будет у вас под рукой. Гарнитуру удобно носить на любом ухе с ушным креплением или без него.', 128.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=1109', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6919, 13, 8, 23, '       Nokia BH-600', 'Гарнитура Nokia BH-600 выполнена в классическом стиле, использует цифровую обработку сигнала для фильтрации шумов. Гарнитура удобно крепится на любом ухе. Функционал: Bluetooth 2.0 с профилями Hands-Free, Headset. Li-ion аккумулятор емкостью 125 mAh позволяет гарнитуре работать в режиме разговора до 7 часов, в режиме ожидания до 170 часов.', 63.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=908', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6920, 13, 8, 23, '       Nokia BH-800', 'Строение корпуса беспроводной гарнитуры Nokia BH-800 позволяет носить ее на любом ухе. Снабжена функциями ответ / окончание вызова, голосовой набор, повторный набор номера. Функционал: Bluetooth 2.0 с профилями Hands-Free и Headset. Литиево-полимерный аккумулятор емкостью 69 mAh позволяет гарнитуре работать до 6 часов в режиме разговора и до 160 часов в режиме ожидания.', 130.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=640', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6918, 13, 8, 23, '       Nokia BH-500', 'Гарнитура Nokia BH-500 поставляется с беспроводным аудиоадаптером, который позволяет слушать музыку и отвечать на звонки. К адаптеру можно подключать любые наушники с разъемом 3,5 мм. Брызгонепроницаемый корпус защищает гарнитуру от дождя. Функционал: Bluetooth 1.2 с профилями Hands-Free, Headset и A2DP. Максимальная дистанция устойчивой связи 10 метров от мобильного телефона. Li-ion аккумулятор емкостью 250 mAh позволяет гарнитуре работать в режиме разговора до 8 часов, в режиме ожидания до 150 часов.', 137.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=907', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6917, 13, 8, 23, '       Nokia BH-300', 'Особенность гарнитуры Nokia BH-300 - ободок, который может быть использован как петля на любое ухо. Возможность изменять цвет петли: темно-серый, розовый, светло-зеленый и медно-коричневый. Функционал: Bluetooth 2.0 со спецификацией EDR и профилями Hands-Free, Headset. Максимальная дистанция устойчивой связи 10 метров от мобильного телефона. Время работы в режиме разговора до 5 часов.', 56.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=638', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6916, 13, 8, 23, '       Nokia BH-200 / HS-58W', 'Беспроводная гарнитура BH-200 выполнена в классическом дизайне от Nokia. Оснащена функциями: включение голосового набора, повторный набор номера, сброс. Функционал: Bluetooth 2.0 с профилями Hands-Free и Headset. Литий-ионная батарея емкостью 69 mAh позволяет гарнитуре работать до 5 часов 30 минут в режиме разговора и до 150 часов в режиме ожидания.', 49.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=637', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6913, 13, 404, 23, '       Jabra BT800', 'Особенностью гарнитуры Jabra BT800 является LCD-дисплей с голубой подсветкой, на котором отображается идентификатор вызывающего абонента. Обладает 5 различными мелодиями вызова. Возможна зарядка непосредственно от компьютера через кабель USB. Поддержка технологии цифровой обработки сигнала (DSP) обеспечивает оптимальные параметры звука в любой обстановке.', 85.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=572', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6914, 13, 404, 23, '       Jabra JX10', 'Jabra JX10 одна из самых компактных гарнитур ее размеры составляют: 40x20x20 мм вес 10 грамм. Гарнитура оснащена цифровым сигнальным процессором (DSP) который устраняет шумы и подстраивает громкость к уровню окружающего шума. Функционал: Bluetooth 1.2 с профилями Hands-Free и Headset. Время работы в режиме разговора 6 часов, в режиме ожидания 200 часов', 108.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=573', 0.00, 0.00, 'Уточняйте');
