INSERT INTO `goods` VALUES (6915, 13, 404, 23, '       Jabra BT250', 'Беспроводная гарнитура Jabra BT250 - усовершенствованная версия модели BT200. Отличие заключается в увеличенном сроке автономной работы: до 8 часов в режиме разговора и до 240 часов в режиме ожидания. Гарнитура оборудована технологией снижающей шумы при разговорах. Поддерживает Bluetooth 1.1 с профилями Headset/ Hands-free, а также голосовой набор номера.', 60.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=569', 0.00, 0.00, 'Уточняйте');
