INSERT INTO `goods` VALUES (6911, 13, 404, 23, '       Jabra BT250v', 'Беспроводная гарнитура Jabra BT250v создана на платформе BT250, ключевое отличие от базовой модели - вибрационный сигнал вызова. Функционал: Bluetooth 1.1 с профилями Hands-Free и Headset, максимальный радиус действия 10 метров, госовой набор. Литий-полимерный аккумулятор предусматривает до 7 часов работы в режиме разговора, и до 200 часов в режиме ожидания.', 53.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=409', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6907, 13, 404, 23, '       Jabra BT-500', 'Гарнитура Jabra BT500 поддерживает до 8 различных Bluetooth-устройств. Функционал: способна принимать входящие вызовы на расстоянии до 10 м от мобильного телефона, совместима со стандартом Bluetooth 1.2, поддерживает Headset и Hands-Free профили, оснащена микрофоном, фильтрующим внешние шумы. Работает до 8 часов в режиме разговора и до 240 часов в режиме ожидания.', 73.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=565', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6908, 13, 404, 23, '       Jabra BT150', 'Из особенностей беспроводной гарнитуры Jabra BT150 стоит отметить: голосовой набор, отбой входящего вызова, ожидание вызова. Гарнитура оснащена Bluetooth 1.2, поддерживает профили Headset/ Hands-Free. Литий-полимерный аккумулятор обеспечивает время работы в режиме разговора до 6 часов, а в режиме ожидания до 110 часов. Гарнитура способна принимать входящие вызовы на расстоянии до 10 метров от мобильного телефона.', 40.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=411', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6905, 13, 403, 23, 'BenQ-Siemens HHB-160', 'Benq-Siemens HHB-160 эргономичная гарнитура, оснащенная функцией голосового набора, так же на корпусе есть клавиши регулировки звука и приема/отклонения входящих звонков. Спецификации: Bluetooth 1.2 и профилями Hands-Free, Headset. Встроенный аккумулятор позволяет гарнитуре работать до 240 часов в режиме ожидания и 8 часов в режиме разговора. Максимальная дальность устойчивой связи до 10 метров.', 71.00, 0.00, 12, '2007-02-21', 'telemarket.com.ua/index.php?productID=910', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6909, 13, 404, 23, '       Jabra BT200', 'Беспроводная гарнитура Jabra BT200 оснащена Bluetooth 1.1 с профилями Hands-Free и Headset. Литий-полимерный аккумулятор позволяет гарнитуре работать до 3 часов в режиме разговора и до 100 часов в режиме ожидания. Гарнитура способна принимать входящие вызовы на расстоянии до 10 метров от мобильного телефона.', 50.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=407', 0.00, 0.00, 'Уточняйте');
INSERT INTO `goods` VALUES (6906, 13, 404, 23, '       Jabra BT-160', 'Телефонная гарнитура Jabra BT160 выполнена в оригинальном дизайне, конструкция корпуса позволяет владельцу персонализировать аксессуар при помощи сменных панелей до 33 сменных панелей. Спецификация Bluetooth версии 1.2. Гарнитура способна принимать входящие вызовы на расстоянии до 10 метров от мобильного телефона. Время работы в режиме разговора до 6 часов, в режиме ожидания до 110 часов.', 46.00, 0.00, 12, '2007-02-21', 'www.telemarket.com.ua/index.php?productID=563', 0.00, 0.00, 'Уточняйте');
